import React from 'react';
import {View, Text} from 'react-native';
import styles from '../styles/styleMenuButton.js'

const MenuButton = (props) => {
    return (
        <View>
        <Image
        style={styles.logo}
        source={{
          uri: props.imageDir,
        }}
      />
        <Text>{props.Text}</Text>
        </View>
    );
};


export default MenuButton
